  \"High-Fidelity Gas and Granular Flow Physics Models for Rocket Exhaust Interaction
  with Lunar Soil Project\",\n\t\"tracking_summary\": {\n\t\t\"total\": 2,\n\t\t\"recent\":
  1\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\": [],\n\t\"revision_timestamp\":
  \"2015-05-07T03:52:06.425988\",\n\t\"name\": \"high-fidelity-gas-and-granular-flow-physics-models-for-rocket-exhaust-interaction-with-lun\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"Soil debris liberated by spacecraft landing
  on the lunar surface may damage and contaminate surrounding spacecraft and habitat
  structures. Current numerical simulations of these events lack credibility because
  lunar environment complexities have never been captured in suitable models: the
  mixed rarefied-continuum nature of the plume's surface layer flow, and the highly
  irregular soil particle shapes with peculiar granular stresses, particle aerodynamics,
  and particle collision characteristics. CFDRC and the University of Florida (UF)
  propose to apply their uniquely capable simulations simulation tools to derive credible
  lunar gas and granular flow physics sub-models from first principles. CFDRC's unified
  continuum-rarefied flow solver will be applied to characterize the surface layer
  flow structure and assess interference effects from surface craters and rocks. The
  code's unique ability to resolve highly irregular shapes with an automated adaptive
  Cartesian approach will be applied to compute realistic particle aerodynamics. A
  Lagrangian particle collision model developed for efficiently simulating dense particle
  streams will characterize particle collision and dispersion effects. A novel fundamental
  soil model developed by UF to describe all constituent stresses in a single fundamental
  model for arbitrary particle shapes mixtures will be applied. Phase I will demonstrate
  the unique capabilities of the proposed simulation tools. During Phase II, these
  tools will be applied to create high fidelity physics sub-models for integration
  in current erosion simulation models.   \",\n\t\"license_title\": \"U.S. Government
